/*Table structure for table `modules` */

DROP TABLE IF EXISTS `modules`;

CREATE TABLE `modules` (
  `id` int(11) NOT NULL auto_increment,
  `module` varchar(20) NOT NULL COMMENT '模块',
  `module_name` varchar(20) NOT NULL COMMENT '模块名',
  `index_order` int(11) default NULL COMMENT '排序',
  `menu_order` int(11) default NULL COMMENT '菜单排序',
  `is_show` tinyint(1) default '0' COMMENT '是否启用，0未启用，1启用',
  `parent` int(3) NOT NULL default '0' COMMENT '父ID',
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

